import React from 'react';
import { Nav, NavItem, NavLink } from 'reactstrap';

const Example = (props) => {
  return (
    <div>
      <p>List Based</p>
      <Nav>
          <NavLink href="#Feed">Feed</NavLink> 

          <NavLink href="#Journal">Journal</NavLink> 

          <NavLink href="#Mood">Mood </NavLink> 

          <NavLink disabled href="#Account">Account </NavLink> 

      </Nav>
      <hr />
      <p>Link Based</p>
      <Nav>
        <NavLink href="#Feed">Feed</NavLink> <NavLink href="#">Link</NavLink> <NavLink href="#">Another Link</NavLink> <NavLink disabled href="#">Disabled Link</NavLink>
      </Nav>
    </div>
  );
}

export default Example;
